import React from "react";
import {Link,} from "react-scroll";
import { useState } from "react";

export default function Navigation({startNotActive}) {

    const [toggleMenu, setToggleMenu] = useState(true)

    const handleToggleMenu = () => {
        setToggleMenu(!toggleMenu)
    }

    const handleCloseMenu = () => {
        setToggleMenu(true)
    }
    
    return (
        <>
          
            <nav >
           <Link to="/" >
                <button >Start</button>
            </Link>
           
           <Link to="/#fourSteps" duration={500}>
            <button className="btn" onBlur={handleCloseMenu}>O co chodzi?</button>
            </Link>

           <Link    to="/HomeAbout7#aboutUs" >
            <button className="btn">O Nas</button>
            </Link>

           <Link to="/#whoWeHelp">
            <button className="btn">Fundacja i organizacje</button>
            </Link>

           <Link to="/#contact">
            <button className="btn">Kontakt</button>
            </Link>

            </nav>
        </>
    )
}
